long long millis() {
    static struct timeval tv;
    gettimeofday(&tv, 0);
    return (tv.tv_sec) * 1000LL+(tv.tv_usec) / 1000LL;
}

int main(int argc, char **argv) {
    if (!screen_create(&screen, 320, 240, 2)) {
        fprintf(stderr, "screen_create() failed\n");
        return 1;
    }

    struct FrameGeometry data = {
        screen.buffer_size,
        screen.width * screen.bpp,
        screen.width,
        screen.height,
        PIXEL_FORMAT_RGB565,
        0,
        MAGIC_NUMBER
    };
    rgbs_set_buffer_data(data);

    if (!rgbs_start()) {
        fprintf(stderr, "Error initializing rgbs\n");
        return 1;
    }

    signal(SIGTERM, InterruptHandler);
    signal(SIGINT, InterruptHandler);

    struct Sprite toaster = {
        (unsigned char *) toaster_bmp,
        256, // width
        64,  // height
        2,   // bpp
        64,  // frame_width
        0,   // frame
        1,   // reverse_anim (t/f)
        1    // anim_dir
    };

    int x = 320;
    int y = -64;
    while (!interrupt_received) {
        long long tick = millis();
        usleep(SYNC_ANIM_DELAY);
        sprite_animate(&toaster);
        x--;
        y++;
        if (x < 64 && y > 256) {
            x = 320;
            y = -64;
        }
        screen_clear(&screen);
        screen_draw_sprite(&screen, &toaster, x, y);
        rgbs_poll();
        rgbs_send(screen.buffer, screen.buffer_size);
    }

    screen_destroy(&screen);

    return 0;
}
